CREATE TABLE `users` ( `id` INT NOT NULL AUTO_INCREMENT , `first_name` VARCHAR(256) NOT NULL , `last_name` VARCHAR(256) NOT NULL , `email` VARCHAR(256) NOT NULL , `gender` VARCHAR(256) NOT NULL , `photo` VARCHAR(256) NOT NULL , `phone` VARCHAR(256) NOT NULL , `slogan` VARCHAR(256) NOT NULL , PRIMARY KEY (`id`)) ENGINE = InnoDB CHARSET=utf8 COLLATE utf8_general_ci;

